// import logo from './logo.svg';
import "./App.css";

const Logo = () => {
  return <h2 className="logo">LOGOBAKERY</h2>;
};

const Links = () => {
  return (
    <ul className="navbar-links">
      <li>Services</li>
      <li>Projects</li>
      <li>About</li>
    </ul>
  );
};

const Button = () => {
  return (
    <div>
      <button className="button">Contact</button>
    </div>
  );
};
function App() {
  return (
    <div>
      <nav className="navbar">
        <Logo></Logo>
        <Links></Links>
        <Button></Button>
      </nav>
    </div>
  );
}

export default App;
